
var jsPDFDiplom = function() {
	var editor;
	var doc = new jsPDF('p', 'in');

	var initDownloadPDF = function() {
		$('#myForm').submit(function(){
			/*eval(editor.getValue());

			var file = demos[$('#template').val()];
			if (file === undefined) {
				file = 'demo';
			}*/
	
			jsPDFDiplom.update();
			 event.preventDefault();


			
		});
		return false;
	};
	

	self.strpad00 = function(s)
	{
	    s = s + '';
	    if (s.length === 1) s = '0'+s;
	    return s;
	}
	


	return {

		init:function() {
			
			initDownloadPDF();

		},
		update: function(){
			setTimeout(function() {
					//Use http://dataurl.net/#dataurlmaker
					//800 pixel width on jpg
				var imgData = 'data:image/jpeg;base64,';

				var d = new Date();
				var strDate = d.getFullYear() + "-" + strpad00(d.getMonth()+1) + "-" + strpad00(d.getDate());
			
				var mytext =$( "input[name='name']" ).val();


				doc.setFontSize(24);
				doc.setFont("times");
				doc.setFontType("italic");
				doc.addImage(imgData, 'JPEG', -0.03,0);




				doc.myText("  " + mytext, {align:"center"}, 0, 3.95);
				doc.setFontSize(13);
					doc.text(3.61, 4.42, strDate);
				
				doc.save('intyg.pdf');
				jsPDFDiplom.init();
			}, 0);
		}
	};

}();







$(document).ready(function() {
	jsPDFDiplom.init();
	// bind 'myForm' and provide a simple callback function 
          
});
